import React from 'react';
import styled from 'styled-components';
import Scroll from 'react-scroll';
const ScrollLink = Scroll.ScrollLink;

const Nav = () => {
  return (
    <Wrapper>
        <Scroll.Link 
        to="projects" 
        spy={true} 
        smooth={true} 
        duration={500} 
        className='element' 
        activeClass='active'
      >
      PROJECTS
      </Scroll.Link> 
        {/* <span>ABOUT</span>
        <span>CONTACT</span> */}
    </Wrapper>
  )
}
const Wrapper = styled.nav`
  position: fixed;
  display: flex;
  justify-content: space-evenly;
  align-items: center;
  bottom: 0px;
  height: 10vh;
  width: 100vw;
  z-index: 1000;
  background-color: #9FD9AD;
`;

export default Nav;
